import React from 'react'
import './Slider.css'
import Background from '../images/pexels-felipe.jpg'


function Slider() {
    return (
        <div className="lander">
            <img src="https://images.unsplash.com/photo-1588444837495-c6cfeb53f32d?ixid=MnwxMjA3fDB8MHxzZWFyY2h8OXx8bmVja2xhY2V8ZW58MHx8MHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60" className="image"></img>

        </div>
    )
}

export default Slider
